		items["sep" + n++] = "------";
		items.loadsession = {name: "load session ..."};
		items.savesession = {name: "save session"};
		items["sep" + n++] = "------";
		items.lite = {name: "new JS9 light window"};
		items.xnew = {name: "new JS9 separate window"};
		items["sep" + n++] = "------";
